import Header from "./components/Header";
import SearchPage from "./components/SearchPage";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
} from "react-router-dom";
import Bookmarks from "./components/Bookmarks";

function App() {
  return (
    <div className="App">
      <Header />
      <Switch>
        <Route path="/" exact>
          <SearchPage />
        </Route>
        <Route path="/bookmarks" exact>
          <Bookmarks />
        </Route>
        <Redirect to="/" />
      </Switch>
    </div>
  );
}

export default App;
